const Header = () =>(
    <div><h1>Half Stack application development</h1></div>
)
const Content = (props) =>(
    <p> {props.name} {props.number}</p>
)
const Total = (props) => (
    <p>Number of exercises {props.one+props.two+props.three}</p>
)
const App = () => {
    const part1 = 'Fundamentals of React'
    const exercises1 = 10
    const part2 = 'Using props to pass data'
    const exercises2 = 7
    const part3 = 'State of a component'
    const exercises3 = 14
    return (
      <div>
          <Header/>
          <Content name={part1} number={exercises1}/>
          <Content name={part2} number={exercises2}/>
          <Content name={part3} number={exercises3}/>
          <Total one={exercises1} two={exercises2} three={exercises3}/>

      </div>
  )
}

export default App
